import React from 'react'
import './Posts.css'
import Post from '../Post/Post';
import {PostData} from '../';

const Posts = () => {
  return (
    <div className="Posts">
              {PostsData.map((post, id)=>{
                    return <Post/>
              })}
    </div>
  )
}

export default Posts
